import React, {Component} from 'react';
import './App.css';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import {combineReducers, createStore} from "redux";
import {Provider} from "react-redux";
import SearchComponent from "./components/SearchComponent";
import Home from "./Home";


const reducers = combineReducers({
    reducer: state
});

const store = createStore(reducers);

const jokes = (url) => {
    alert("Oh yeah " + url)
}

class App extends Component {
constructor(){
const state = {
    keyword:''
};

}

    render(){
  return (
      <Provider store={store}>
          <Router>
              <div>
                  <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                      <a className="navbar-brand" href="/">Mind-Assistant</a>

                      <div className="collapse navbar-collapse">
                          <ul className="navbar-nav mr-auto">
                          </ul>
                          <form className="form-inline my-2 my-lg-0">
                              <input value={this.state.keyword} className="form-control mr-sm-2" type="search" placeholder="Search"
                                     aria-label="Search"/>
                              <Link to={"/search"}>
                                  <button onClick={() => jokes("url here")} className="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
                              </Link>
                          </form>
                      </div>
                  </nav>

                  <Switch>
                      <Route
                          path={"/search"}
                          render={(props) =>
                              <SearchComponent
                                  {...props}
                              />
                      }/>
                      <Route path={"/"}>
                          <Home/>
                      </Route>
                  </Switch>
              </div>
          </Router>
      </Provider>
  );
}
}
export default App;
